import React from "react";
import PlaneService from "../services/PlaneService";


class IberianPeninsulaComponent extends React.Component {

    constructor(props){
      super(props)
        this.state = {
          planes:[]
        }
      this.loadData = this.loadData.bind(this);
    }

    componentDidMount(){
      this.loadData();
      setInterval(this.loadData, 10000);
    }

    async loadData() {
        try {
            PlaneService.getPlanesIp().then((response) => {
                this.setState({
                planes: response.data
            })
        });
        } catch (e) {
            console.log(e);
        }
    }

    render(){
      return(
        <div>
          <h1 className="text-center"> Iberian Peninsula Plane List </h1>
          <table className = "table table-striped">
            <thead>
              <tr>
                <td>Icao24</td>
                <td>Callsign</td>
                <td>Origin Country</td>
                <td>Longitude</td>
                <td>Latitude</td>
              </tr>
            </thead>
              <tbody>
                {
                  this.state.planes.map(
                    plane =>
                    <tr key = {plane.id}>
                      <td>{plane.icao}</td>
                      <td>{plane.callsign}</td>
                      <td>{plane.origin_country}</td>
                      <td>{plane.longitude}</td>
                      <td>{plane.latitude}</td>
                    </tr>
                  )
                }
              </tbody>
          </table>
        </div>
      )
    }
}

export default IberianPeninsulaComponent
